import { Link } from "react-router-dom";

const HostList= (props) => {
  return (
    <>
      <h1>HostSearchList</h1>

      <ul>
        {props.hosts.map((host) => (
          <li key={host.id}>
            <Link to={host.id}>{host.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}

export default HostList;
